const NotFound = () => {
    return(
        <div className="bg-[image-url] bg-cover bg-center" >

<div className="relative mx-auto border-gray-800 dark:border-gray-800 bg-gray-800 border-[14px] rounded-[2.5rem] h-auto w-[300px] mt-5 mr-40 shadow-xl">
    <div className="w-[148px] h-[18px] bg-gray-800 top-0 rounded-b-[1rem] left-1/2 -translate-x-1/2 absolute"></div>
    <div className="h-auto w-[3px] bg-gray-800 absolute -left-[17px] top-[124px] rounded-l-lg"></div>
    <div className="h-auto w-[3px] bg-gray-800 absolute -left-[17px] top-[178px] rounded-l-lg"></div>
    <div className="h-auto w-[3px] bg-gray-800 absolute -right-[17px] top-[142px] rounded-r-lg"></div>
    <div className="rounded-[2rem] overflow-hidden w-[272px] h-[572px] bg-white dark:bg-gray-800">
        <img src="fall.jpg" className="dark:hidden w-[272px] h-[572px]" alt=""/>
        <img src="" className="hidden dark:block w-[272px] h-[572px]" alt=""/>
    </div>
</div>

        </div>
    );
};
export default NotFound;
